INSERT INTO `menu_router` VALUES ('node/add/article','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:7:\"article\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/article','Article','check_plain','',6,'','An <em>article</em> is suitable for news items and press releases. By default, an <em>article</em> entry is automatically featured on the site front page, and provides the ability to post comments.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/credit','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:6:\"credit\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/credit','Credit','check_plain','',6,'','A <em>credit</em> content type is suitable for displaying for the project credits, a legal notice or a disclaimer. They will be shown in the footer on every page of the site.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/event','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:5:\"event\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/event','Event','check_plain','',6,'','An <em>event</em> is suitable for any content that is strongly associated with a date, such as a meeting or a conference. Events are displayed in a calendar accessible from the main menu.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/outcome','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:7:\"outcome\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/outcome','Outcome','check_plain','',6,'','An <em>outcome</em> is suitable for presenting outcomes of the project, such as meeting reports with presentations, files, external links, videos and images. The latest inserted outcomes are displayed on the front page.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/page','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:4:\"page\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/page','Page','check_plain','',6,'','A <em>page</em> is suitable for information that rarely changes, such as an \"About us\" section of a website or institutional information. By default, a <em>page</em> entry does not allow visitor comments.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/partner','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:7:\"partner\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/partner','Partner','check_plain','',6,'','A <em>partner</em> content type is suitable for creating and displaying partners of your project. <em>Partners</em> will be featured with their logo on the homepage, and you can give some more information and a link to their website.','',0,'modules/node/node.pages.inc');
INSERT INTO `menu_router` VALUES ('node/add/spotlight','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:9:\"spotlight\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/spotlight','Spotlight','check_plain','',6,'','The <em>spotlight</em> is the main feature of your website. It is prominently displayed on the front page and it should engage website visitors.','',0,'modules/node/node.pages.inc');
